import React from 'react';
import {useSelector} from 'react-redux';
import { Route} from 'react-router-dom';
import { ThemeProvider } from 'styled-components';
import {AppStyle, theme} from './styled/theme';
import Navbar from './components/navbar';
import RecentImgs from './components/recent';
import UserStory from './components/user';
import Login from './components/login';
import SignUp from './components/signup';
import {AuthRoute} from './util/route';
function App() {
	const session = useSelector( 
		state => state.session,
	);
	return (
		<ThemeProvider theme={theme}>
			<AppStyle>
				<Navbar />
				<AuthRoute exact path="/" component={RecentImgs} />
				<AuthRoute exact path="/login" component={Login} />
				<AuthRoute exact path="/signup" component={SignUp} />
				<Route path='/user/:id' component={UserStory} />

			</AppStyle>
		</ThemeProvider>
	);
}

export default App;
